import React, { Component } from "react";

class Button extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <button
        className={`border-2 border-gray-600 rounded-lg ${this.props.bgColor} ${this.props.textColor} w-24 font-bold p-3 flex justify-center items-center mr-14 ${this.props.bgHover}300 shadow-inner`}
      >
        {this.props.title}
      </button>
    );
  }
}

Button.defaultProps = {
  title: "",
  bgColor: "bg-sky-300",
  textColor: "text-black",
};

export { Button };
